import 'package:equatable/equatable.dart';

import 'data.dart';

class AzanModel extends Equatable {
  final int? code;
  final String? status;
  final Data? data;

  const AzanModel({this.code, this.status, this.data});

  factory AzanModel.(
      Map<String, dynamic> json) {
    return AzanModel(
      code: json['code'] as int?,
      status: json['status'] as String?,
      data: json['data'] == null
          ? null
          : Data
              .(
                  json['data'] as Map<String, dynamic>),
    );
  }

  Map<String, dynamic>
      () {
    return {
      'code': code,
      'status': status,
      'data': data
          ?.(),
    };
  }

  @override
  List<Object?> get props => [code, status, data];
}
